CREATE DEFINER=`root`@`localhost` PROCEDURE `add_invoice`(IN invoiceNumber INT, IN invoiceLineNumber INT, IN patientNumber INT,
							IN invoiceDate DATE, IN invoiceLineAmount INT)
begin
DECLARE invoiceExists INT;
DECLARE invoiceLineItemExists INT;

SELECT EXISTS(SELECT * from invoices WHERE invoice_number =  invoiceNumber) into invoiceExists;
SELECT EXISTS(SELECT * from invoices_items WHERE invoice_number =  invoiceNumber and invoice_line_item = invoiceLineNumber) into invoiceLineItemExists;

IF invoiceExists = 0 then 
INSERT INTO invoices values (invoiceNumber, patientNumber, invoiceDate);
INSERT INTO invoices_items VALUES (invoiceLineNumber, invoiceNumber, invoiceLineAmount);
ELSE 
	IF invoiceExists = 1 then 
    INSERT INTO invoices_items VALUES (invoiceLineNumber, invoiceNumber, invoiceLineAmount);
    END IF;  
END IF;

end ;;
DELIMITER ;
